package com.example.utils;

import javax.crypto.Cipher;
import javax.crypto.spec.IvParameterSpec;
import javax.crypto.spec.SecretKeySpec;
import java.util.Base64;

public class AESDecryptionExample {
    public static void main(String[] args) throws Exception {
        String key = "ygcnbclnqzsmebxd";
        String iv = "8249692684143708";
        String hexString = "";

        // 将十六进制字符串转换为字节数组
        byte[] ciphertext = hexStringToByteArray(hexString);

        // 尝试使用 AES 解密算法进行解密
        String decryptedText = decryptAES(ciphertext, key, iv);
        System.out.println("Decrypted Text: " + decryptedText);
    }

    public static byte[] hexStringToByteArray(String hexString) {
        int len = hexString.length();
        byte[] data = new byte[len / 2];
        for (int i = 0; i < len; i += 2) {
            data[i / 2] = (byte) ((Character.digit(hexString.charAt(i), 16) << 4)
                + Character.digit(hexString.charAt(i+1), 16));
        }
        return data;
    }

    public static String decryptAES(byte[] ciphertext, String key, String iv) throws Exception {
        SecretKeySpec secretKey = new SecretKeySpec(key.getBytes(), "AES");
        IvParameterSpec ivParameterSpec = new IvParameterSpec(iv.getBytes());

        Cipher cipher = Cipher.getInstance("AES/CBC/PKCS5Padding");
        cipher.init(Cipher.DECRYPT_MODE, secretKey, ivParameterSpec);

        byte[] decryptedBytes = cipher.doFinal(ciphertext);
        return new String(decryptedBytes);
    }
}
